import React from 'react';
import {Jumbotron, Container} from 'react-bootstrap';
import Title from './Title';

const Home = () => {

    return (
        <div>
          <Container>
          <div className="box">
            <Title text="Allergies" />
          </div>
          </Container>
        <div>
            <h1>Hello, world</h1>
        </div>
        </div>
    )
}

export default Home;
